import React, { Component } from "react";
import  './register.css';

export default class Login extends Component {
    constructor(props) {
        super(props);
        this.state =
        {
            username: "",
            password: ""
        };
    }

    handleChange = event => {
        this.setState({
            [event.target.name]: event.target.value
        });
    };

    handleSubmit = event => {
        console.log("Submitting");
        console.log(this.state);
    };

    render() {
        return (
            <div className="card box_shw2 border-0 px-3 rounded-2 mb-3 w_500 py-4 mx-auto mt-5">
            <form>
                <h3>Sign In</h3>

                <div className="form-group">
                    <label>Username</label>
                    <input type="text" className="form-control" placeholder="Enter username" required="required" name="name" value={this.state.name}/>
                </div>

                <div className="form-group">
                    <label>Password</label>
                    <input type="password" className="form-control" placeholder="Enter password" required="required" name="password" value={this.state.password}/>
                </div>



                <button type="submit" className="btn btn-primary btn-block">Login</button>
                <p className="forgot-password text-right">
                    New User ? <a href="/register"> Register here</a>
                </p>
            </form>
            </div>
        );
    }
}
